import React from 'react';
import ProjectCard from './ProjectCard';
import './css/Projects.css';
import LoM0 from '../img/LoM0.png'; 
import penguin0 from '../img/penguin0.jpg';
import GOA0 from '../img/GOA0.png';
import Abyss0 from '../img/Abyss0.png';
import Milky0 from '../img/Milky0.png';
function Projects() {
  const projectData = [
    { id: 1, media: LoM0, title: 'Library of Meialia' },
    { id: 2, media: penguin0, title: 'Waddle: A Penguin\'s Tale' },
    { id: 3, media: GOA0, title: 'Beyond the Garden of Adrian' },
    { id: 4, media: Abyss0,  title: 'Abyss Bridge'},
    { id: 5, media: Milky0, title: 'Probe the Milky Way Density Structure'}
  ];

  return (
    <div className="projects-container">
      <div className="projects-grid">
        {projectData.map(project => (
          <ProjectCard 
            key={project.id} 
            media={project.media} 
            link={`/projects/${project.id}`} 
            title={project.title} 
          />
        ))}
      </div>
    </div>
  );
}

export default Projects;
